```
**Step 5: Add event listeners**

Add the following event listeners to the `Card` component to handle the drag end event:
```jsx
import React from'react';

const Card = ({ title, onDragEnd }) => {
  const handleDragEnd = () => {
    onDragEnd();
  };

  return (
    <div className="card" draggable={true} onDragEnd={handleDragEnd}>
      <h3>{title}</h3>
    </div>
  );
};

export default Card;
```
This component now has a `draggable` attribute and an `onDragEnd` event listener to handle the drag end event.

**Step 6: Create the Draggable component**

Create a new file called `Draggable.js` and add the following code:
```jsx
import React from'react';

const Draggable = ({ draggableId, position, children, onDrag }) => {
  return (
    <div
