**Step 3: Create the Kanban board component**

Create a new file `KanbanBoard.js` and add the following code:

```jsx
import React, { useState } from'react';
import { Droppable } from'react-beautiful-dnd';
import { Kanban } from'react-kanban';

const columns = [
  { id: 'to-do', title: 'To-Do', initialCards: 5 },
  { id: 'in-progress', title: 'In Progress', initialCards: 3 },
  { id: 'done', title: 'Done', initialCards: 2 },
];

const KanbanBoard = () => {
  const [columns, setColumns] = useState(columns);

  const onDragEnd = (result) => {
    if (!result.destination) return;
    const { source, destination } = result;
    if (source.droppableId === destination.droppableId) return;
    const cards = Array.from(columns[source.droppableId].cards);
    const [removedCard] = cards.splice(source.index, 1);
    cards.splice(destination.index, 0, removedCard);
    setColumns(columns.map((column) => {
      if (column.id === source.droppableId) {
        return {...column, cards };
      }
      return column;
    }));
    if (destination.droppableId!== source.droppableId) {
      const destinationColumn = columns[destination.droppableId];
      destinationColumn.cards = destinationColumn.cards || [];
      destinationColumn.cards.splice(destination.index, 0, removedCard);
      setColumns(columns.map((column) => {
        if (column.id === destination.droppableId) {
          return {...column, cards: destinationColumn.cards };
        }
        return column;
      }));
    }
  };

  return (
    <Kanban columns={columns} onDragEnd={onDragEnd}>
      {columns.map((column) => (
        <Droppable key={column.id} droppableId={column.id}>
          {(provided) => (
            <div
              ref={provided.innerRef}
              {...provided.droppableProps}
              style={{
                width: '300px',
                padding: 10,
                border: '1px solid #ddd',
              }}
            >
              <h2>{column.title}</h2>
              {column.cards.map((card, index) => (
                <div
                  key={card.id}
                  style={{
                    width: '100%',
                    padding: 10,
                    border: '1px solid #ddd',
                    marginBottom: 10,
                  }}
                >
                  <h3>{card.title}</h3>
                </div>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      ))}
    </Kanban>
  );
};

export default KanbanBoard;
```

