The correct answer is C: Functions and methods are different. A function is called by name and must always pass and return data, whereas a method can only be called when an object of a class calls it.

Here's why:

* Functions are standalone blocks of code that can be called by their name, regardless of any specific object or class. They don't have access to any data or state, and they always pass and return data.
* Methods, on the other hand, are blocks of code that are part of a class or object. They have access to the data and state of the object, and they can modify it. Methods can only be called when an object of the class calls them.

For example, in Java, a function might look like this:
```java
public static int add(int a, int b) {
    return a + b;
}
```
This function can be called by its name, without any specific object or class:
```java
int result = add(2, 3);
```
On the other hand, a method might look like this:
```java
public class MyClass {
    private int x;

    public void increment() {
        x++;
    }

    public int getX() {
        return x;
    }
}
```
This method can only be called when an object of the class is created and called:
```java
MyClass obj = new MyClass();
obj.increment();
int result = obj.getX();
```
So, while functions and methods share some similarities, they are fundamentally different in terms of their scope, access to data, and usage.

