import org.java_websocket.WebSocket;
import org.java_websocket.WebSocketFactory;
import org.java_websocket.client.WebSocketClient;
import org.java_websocket.drafts.Draft;
import org.java_websocket.handshake.ServerHandshake;

public class WebSocketClient {
    private static final String STOMP_ENDPOINT = "ws://your-backend-url.com/stomp";
    private static final String SOCKJS_ENDPOINT = "http://your-backend-url.com/sockjs";

    public static void connect() {
        WebSocketFactory factory = new WebSocketFactory();
        factory.setDraft(Draft.V13);
        WebSocketClient client = new WebSocketClient(factory) {
            @Override
            public void onOpen(ServerHandshake serverHandshake) {
                System.out.println("Connected to " + serverHandshake.getUri());
            }

            @Override
            public void onMessage(String message) {
