**Installation**

```bash
npm install xlsx
```

**Example**

```javascript
const xlsx = require('xlsx');

// Read file
const workbook = xlsx.readFile('example.xlsx');

// Get first sheet
const worksheet = workbook.Sheets['Sheet1'];

// Loop through rows
worksheet['!rows'].forEach((row, index) => {
  const rowValues = row.map((cell) => cell.v);
  console.log(rowValues);
});

// Write to file
xlsx.writeFile(workbook, 'example.xlsx');
```

### 3. excel4node

excel4node is a library for reading and writing Excel files in Node.js.

**Installation**

```bash
npm install excel4node
```

**Example**

```javascript
const Excel = require('excel4node');

