In your Angular component, import the Wistia Uploader library:
```typescript
import { Component } from '@angular/core';
import { WistiaUploader } from '@wistia/wistia-uploader';
```
**Step 3: Create a Wistia Uploader instance**

Create a Wistia Uploader instance and pass your Wistia API credentials:
```typescript
@Component({
  selector: 'app-wistia-uploader',
  template: `
    <button (click)="selectFile()">Select File</button>
    <div *ngIf="uploadedFile">
      <img [src]="uploadedFile.url" alt="Uploaded File">
    </div>
  `
})
export class WistiaUploaderComponent {
  uploadedFile: any;
  wistiaApiToken: string;
  wistiaApiSecret: string;

  constructor() {
    this.wistiaApiToken = 'YOUR_WISTIA_API_TOKEN';
    this.wistiaApiSecret = 'YOUR_WISTIA_API_SECRET';
  }

  selectFile() {
    const uploader = new WistiaUploader({
      token: this.wistiaApiToken,
      secret: this.wistiaApiSecret,
      name:'my-uploader',
      container: document.getElementById('uploader-container'),
      maxFiles: 1,
      accept: 'video/*',
    });

    uploader.on('select', (file) => {
      this.uploadedFile = file;
    });

    uploader.on('upload', (file) => {
      this.uploadedFile = file;
    });

    uploader.on('error', (error) => {
      console.error(error);
    });
  }
}
