    apiKey: 'YOUR_API_KEY',
    videoId: 'VIDEO_ID',
    uploadUrl: 'https://your-wistia-domain.com/asset/upload',
  };

  onUpload(event: any) {
    console.log(event);
  }
}
```
**Step 3: Configure the Wistia Uploader options**

In the `uploaderOptions` object, you need to provide the following:

* `apiKey`: Your Wistia API key
* `videoId`: The ID of the Wistia video you want to upload
* `uploadUrl`: The URL where the uploaded video will be stored

**Step 4: Use the Wistia Uploader**

In the `onUpload` method, you can access the uploaded video data as an event parameter.

